/* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react';
import Link from 'next/link';
import { HeaderNav, HeaderMenu } from './styles';

const Header = () => (
  <HeaderNav>
    <img src="/images/logo.svg" alt="logo" />
    <nav>
      <HeaderMenu>
        <Link href="/">
          <a>Teste</a>
        </Link>
        <li>Teste</li>
        <li>Teste</li>
        <li>Teste</li>
      </HeaderMenu>
    </nav>
  </HeaderNav>
);

export default Header;
